INSERT INTO `forum_posts` VALUES (1,1,'CoreManager Team',1,1,1,'Hello Admin!','[b]Hi[/b]!! :D\r\n\r\nIf you are reading this, that means that you have [i]correctly[/i] installed this forum, XD\r\n\r\n\r\n\r\nSo what\' s next?\r\n\r\nEdit [color=\"red\"]forum.conf.php[/color]\r\n\r\n\r\n\r\nAnd enjoy!\r\n\r\n\r\n\r\nReport bugs at the [url=\"http://trac6.assembla.com/coremanager\"]CoreManager Trac[/url]\r\n\r\n\r\n\r\nThank you,\r\nCoreManager Team','00/00/00 00:00:00',1,0,0);
